import info from '../data/info.json';
import '../App.css';
import ClubList from './ClubList';

function App() {
  return (
    <div className="App">
      <h1>Lista de clubs:</h1>
      <ul>
       <ClubList clubs={info} />
      </ul>
    </div>
  );
}

export default App;
